import React,{Component}from 'react';
import axios from 'axios';
import BugRow from '../components/BugRow.component'
import SystemGrath from'../components/SystemGrafth.component'
import '../components/Admin.css'
class Admin extends Component{
    constructor(props){
        super(props);
        this.state={
            Users:[],
            Requsts:[],
            Bugs:[],
            SVMS:["coconut","lime","grapefruit","mango"]
            
        }
    }
    async dataAsamble(){
        let Users;
        let Requsts;
        let Bugs;
        await axios.get("http://localhost:3000/users/")
            .then((res)=>Users=res.data);
        await axios.get(`http://localhost:3000/Request/`)
            .then((res)=>Requsts=res.data)
        await axios.get(`http://localhost:3000/Bug/`)
            .then((res)=>Bugs=res.data)
        this.setState({
            Users:Users,
            Requsts:Requsts,
            Bugs:Bugs,
        })
    }
    componentDidMount(){
        this.dataAsamble()
    }
    BugTable(){
        return this.state.Bugs.map(CurrentBug=>{
            const status=CurrentBug.status;
            return((status==="pending")?
                        <tbody className="table-striped col-md-3 mt-3"  key={CurrentBug._id}>
                            <BugRow Username={CurrentBug.username}  email={CurrentBug.email}
                            Description={CurrentBug.Description} File={CurrentBug.File}
                            id={CurrentBug._id}/>
                        </tbody>:null)
                    })
                }
render(){
    console.log(this.state)
    return(
    <>
    <div className="cuntiner-fluid">
        <div classname="row">
            <nav id="sidebarMenu" className="col-md-3 col-lg-2 d-md-block bg-light sidebar collapse">
                <div classname="sidebar-sticky pt-3">
                    <ul className="nav flex-column">
                        <li className="nav-item">
                            <a className="nav-link active"></a>
                        </li>
                        <li className="nav-item">hello</li>
                        <li className="nav-item">hello</li>
                        <li className="nav-item">hello</li>
                    </ul>
                </div>
            </nav>
            <main role="main" className="col-md-9 ml-sm-auto col-lg-10 px-md-4">
                <div className="chartjs-size-monitor" style={{positon: 'absolute',left: '0px', top: '0px', right: '0px', bottom: '0px', overflow: 'hidden', visibility: 'hidden'}}></div>
                    <div className="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
                        <h1 className="h2">Dashboard</h1>
                            <div className='btn-toolbar mb-2 mb-md-0'>
                            <button type='button' className='btn btn-sm btn-outline-secondary dropdown-toggle'>{
                            <svg width="1em" height="1em" viewBox="0 0 16 16" class="bi bi-calendar-date" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
                                <path fill-rule="evenodd" d="M3.5 0a.5.5 0 0 1 .5.5V1h8V.5a.5.5 0 0 1 1 0V1h1a2 2 0 0 1 2 2v11a2 2 0 0 1-2 2H2a2 2 0 0 1-2-2V3a2 2 0 0 1 2-2h1V.5a.5.5 0 0 1 .5-.5zM1 4v10a1 1 0 0 0 1 1h12a1 1 0 0 0 1-1V4H1z"/>
                                <path d="M6.445 11.688V6.354h-.633A12.6 12.6 0 0 0 4.5 7.16v.695c.375-.257.969-.62 1.258-.777h.012v4.61h.675zm1.188-1.305c.047.64.594 1.406 1.703 1.406 1.258 0 2-1.066 2-2.871 0-1.934-.781-2.668-1.953-2.668-.926 0-1.797.672-1.797 1.809 0 1.16.824 1.77 1.676 1.77.746 0 1.23-.376 1.383-.79h.027c-.004 1.316-.461 2.164-1.305 2.164-.664 0-1.008-.45-1.05-.82h-.684zm2.953-2.317c0 .696-.559 1.18-1.184 1.18-.601 0-1.144-.383-1.144-1.2 0-.823.582-1.21 1.168-1.21.633 0 1.16.398 1.16 1.23z"/>
                            </svg>}{" Select date"}
                        </button>
                    </div>
                </div>
                <h2> Users</h2>
            </main>
        </div>
    </div>
    </>
    )}
    }
export default Admin



